	(16, 13, 14, '- Schalke bardzo nalegało, ale z szacunku dla kibiców BVB nie podejmowałem w ogóle tego tematu. Wciąż wierzę, że w piłce i w życiu ważne jest coś więcej, niż tylko pieniądze - napisał w oficjalnym oświadczeniu reprezentant Polski. Jego słowa z pewnością ucieszyły sympatyków ekipy z Signal Iduna Park, ale zdenerwowały Heldta, który natychmiast zareagował.\r\n\r\n- Słowa Błaszczykowskiego to jakaś kompletna bzdura. Co prawda jego doradca kilkakrotnie oferował nam usługi swojego podopiecznego, a także pytał, ile mógłby zarobić w Schalke, ale ja nigdy na to nie odpowiedziałem, więc nie było negocjacji - skomentował dyrektor', 1, '2015-09-02 09:09:01', '2015-09-02 09:12:53', NULL),
